import React, { useState, useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'; // Import Bootstrap CSS
import SideNavbar from "../../components/Doctor/sidenavbar";
import Navbar from "../../components/Doctor/Navbar";
import "../../css/Doctor/ddashboard.css";

export default function UploadSchedule() {
  // Define dummy schedule data
  const scheduleData = {
    "slots": [
      [2024, 4, 5, 11, 15],
      [2024, 4, 6, 15, 45],
      [2024, 4, 7, 15, 0],
      [2024, 4, 6, 15, 45],
      [2024, 4, 5, 15, 0]
    ],
    "appointments": [
      { id:1, date: [2024, 4, 5], time: '09:00', patientName: 'John Doe' },
      { id:2, date: [2024, 4, 6], time: '10:30', patientName: 'somebody someone' },
      { id:3, date: [2024, 4, 7], time: '11:15', patientName: 'Alice Smith' },
      { id:5, date: [2024, 4, 6], time: '09:00', patientName: 'John Doe' }
    ]
  };

  // State for schedule data
  const [schedule, setSchedule] = useState([]);

  // State for editing mode
  const [isEditing, setIsEditing] = useState(false);

  useEffect(() => {
    // Initialize schedule with dummy data
    setSchedule(scheduleData);
  }, []);

  // Function to toggle editing mode
  const handleEdit = () => {
    setIsEditing(!isEditing);
  };

  // Function to handle cell click (toggle availability)
  const handleCellClick = (dateIndex, timeIndex) => {
    if (isEditing) {
      // Handle cell click based on editing mode if needed
    }
  };




  const generateScheduleRows = () => {
    if (!schedule.slots || !schedule.appointments) {
      return null; // Return null if schedule data is not properly initialized
    }

    const rows = [];

    schedule.slots.forEach((slot, dateIndex) => {
      const [year, month, day, ,] = slot;
      const slotDate = new Date(year, month - 1, day);
      const rowData = [<th key={dateIndex}>{slotDate.toLocaleDateString()}</th>];

      const timeSlots = generateTimeSlots(); // Generate time slots for each date

      timeSlots.forEach((timeSlot, timeIndex) => {
        const [timeHour, timeMinute] = timeSlot;
        const timeSlotDate = new Date(year, month - 1, day, timeHour, timeMinute);
        const appointment = schedule.appointments.find(appt => {
          const [apptYear, apptMonth, apptDay] = appt.date;
          return apptYear === year && apptMonth === month && apptDay === day && appt.time === `${timeHour}:${timeMinute}`;
        });

        const cellClass = getClassForCell(slotDate, timeSlotDate, appointment);
        rowData.push(
          <td
            key={`${dateIndex}-${timeIndex}`}
            className={cellClass}
            onClick={() => handleCellClick(dateIndex, timeIndex)}
          ></td>
        );
      });

      rows.push(<tr key={dateIndex}>{rowData}</tr>);
    });

    return rows;
  };


  // Function to generate time slots from 9 AM to 3:45 PM with 45 minutes interval
  const generateTimeSlots = () => {
    const timeSlots = [];
    for (let hour = 9; hour <= 15; hour++) {
      for (let minute = 0; minute < 60; minute += 45) {
        timeSlots.push([hour, minute]);
      }
    }
    return timeSlots;
  };

  // Function to get CSS class for cell based on availability
  const getClassForCell = (slotDate, timeSlotDate, appointment) => {
    if (appointment && timeSlotDate.getTime() === new Date(appointment.date[0], appointment.date[1] - 1, appointment.date[2], appointment.time.split(':')[0], appointment.time.split(':')[1]).getTime()) {
      return 'table-danger bg-danger text-dark'; // Red for booked appointments
    } else if (slotDate.getTime() === timeSlotDate.getTime()) {
      return 'table-success bg-success text-white'; // Green for available slots
    } else {
      return 'table-secondary bg-secondary text-white'; // Grey for rest
    }
  };

  return (
    <div className='dashboard-container'>
      <Navbar />
      <div className= 'dashboard-content'>
        <SideNavbar />
        <div className="main-content">
          <h2>This week's Schedule</h2>
          <table className="table table-bordered custom-box khus">
            <thead>
              <tr>
                <th></th>
                <th>9:00 AM</th>
                <th>9:45 AM</th>
                <th>10:30 AM</th>
                <th>11:15 AM</th>
                <th>12:00 PM</th>
                <th>12:45 PM</th>
                <th>01:30 PM</th>
                <th>02:15 PM</th>
                <th>03:00 PM</th>
                <th>03:45 PM</th>
              </tr>
            </thead>
            <tbody>
              {generateScheduleRows()}
            </tbody>
          </table>

          <button type="button" className="btn btn-primary custom-button" onClick={handleEdit}>
            {isEditing ? 'Cancel Edit' : 'Edit Schedule'}
          </button>
          {isEditing && (
            <button type="button" className="btn btn-primary custom-button" onClick={handleSubmit}>
              Submit
            </button>
          )}
        </div>
      </div>
    </div>
  );
}
